import React from "react";
import "../App.css";

function Alternatives(props) {
    return(
        <div>
            <button type="answer" 
                    style={{display: !props.answer && "none"}}>
                    {props.answer}
            </button>  
        </div>
        
    )
}

export default Alternatives
